package andOrNegate;import java.util.HashSet;import java.util.Iterator;import java.util.Set;public class HashSetExample {    public static void main(String[] args) {        Set<String> set = new HashSet<>();        set.add("java");        set.add("JDBC");        set.add("Servlet");        set.add("Spring");        set.add("java");        set.add("iBATIS");        int size = set.size();        System.out.println("총 객체 수 = " + size);        Iterator<String> iter = set.iterator();        while (iter.hasNext()) {            System.out.println(iter.next());        }    }}